import { Notification, Section } from 'rbx';
import "./App.scss";
// import HomeScreen from './screens/home';


const App = () => (
    <Fragment>
        <HomeScreen/>
        <Section>
            <Notification color="success">
                Javascript Notes!
            </Notification>
        </Section>
    </Fragment>
)

export default App;
